INSERT INTO public."Product" (name,description,old_price,new_price,image,available,created_at,update_at,brand) VALUES
	 ('REDCON1 MRE RTD – Thức Uống Protein Pha Sẵn Có Hương Vị Thơm Ngon Nhất','MRE® PROTEIN SHAKE có cấu hình thành phần tương tự như toàn bộ dòng MRE: nguồn protein thực phẩm toàn phần, không chứa bất kỳ whey hoặc lactose nào và hương vị thơm ngon. ',0,1400000,'https://res.cloudinary.com/dr98sm712/image/upload/v1712160501/salcgtyxnlbjbbladpbb.jpg',33,'2024-03-10 09:28:24.981','2024-06-01 11:57:10.199','Labrada'),
	 ('AMINO K.E.M Nguồn Năng lượng tập luyện cao cấp nhất','Amino K.E.M bổ sung năng lượng tập luyện sẽ giải quyết điều đó. Sản phẩm intra workout cao cấp này sẽ bổ sung năng lượng EAA+, với 9 loại acids thiết yếu tăng khả năng hồi phục cho bạn.',1300000,1200000,'https://res.cloudinary.com/dr98sm712/image/upload/v1712160552/glyw4tnxi3cnvl7wsy4h.jpg',0,'2024-03-10 09:28:24.981','2024-06-19 15:03:09.044','Labrada'),
	 ('Nutricost Tudca - 60 viên','Nutricost Tudca 60 viên chứa hàm lượng cao Axit Tauroursodeoxycholic (Tudca). Chất này đã được ứng dùng suốt hàng thế kỷ nhờ những công dụng tuyệt vời đối với gan và túi mật. Tudca cũng được chứng minh công dụng bảo vệ võng mạc.',0,500000,'https://res.cloudinary.com/dr98sm712/image/upload/v1716391064/blog-mern-typescript/vwv95i6srokmph6sodk8.jpg',93,'2024-05-22 15:17:44.931','2024-07-09 13:42:03.493','Nutricost '),
	 ('Nu U Natural Astaxanthin 12mg - 180 viên','Một trong những sản phẩm chống lão hóa hàng ưu việt được nhiều người yêu thích và sử dụng đó chính là Nu U Natural Astaxanthin 12mg. Đây là viên uống bổ sung Astaxanthin - một loại sắc tố màu đỏ có trong thịt cá hồi, cua, tôm hùm và tôm có màu đỏ hồng. Hợp chất này còn gọi là caroten, giúp cho động vật giáp xác trở nên rực rỡ và sống động hơn. Nhiều nghiên cứu đã chỉ ra rằng nó có thể cải thiện sức khỏe và giải quyết các vấn đề sức khỏe tiềm ẩn.',0,400000,'https://res.cloudinary.com/dr98sm712/image/upload/v1716391329/blog-mern-typescript/wvzr0grgq0iwkiajumul.jpg',62,'2024-05-22 15:22:09.466','2024-07-10 04:43:25.907','NU U NUTRITION'),
	 ('ISO Whey LABRADA -Whey Protein Isolate','100% Whey Protein Isolate, không chứa Gluten, không chứa Lactose, không chứa đường, ít Carbs, có chứa Glutamine hỗ trợ tốt cho việc phục hồi',0,1750000,'https://www.wheystore.vn/images/products/2023/12/14/large/muscle-mass-gainer-12lbs_1702547889.jpg.webp',60,'2024-03-10 09:28:24.981','2024-07-07 03:33:15.594','Labrada'),
	 ('Labrada Pump Pro Series – Đệ Nhất Pre-Workout','Công nghệ mới mang tính đột phá của Pump giúp tối đa hóa lưu lượng máu nhanh hơn và mạnh mẽ hơn với các thành phần được cấp bằng sáng chế',0,160000,'https://res.cloudinary.com/dr98sm712/image/upload/v1718897804/blog-mern-typescript/zp2szxukdlkaunipjunq.png',89,'2024-06-20 15:36:43.978','2024-07-03 10:14:38.289','Labrada'),
	 ('RSP AminoLean Năng lượng Gym bùng nổ 123','Amino thiết yếu phục hồi cơ bắp - BCAA xây dựng cơ nạc. L-Carnitine đốt mỡ và giảm đau cơ - Caffeine và Trà xanh thiên nhiên đốt mỡ và cảm nhận tốt cơ 0 đường 0 calo 0 carb - Mùi vị tuyệt vời',900000,400000,'https://i.ebayimg.com/images/g/7hwAAOSwIwlmOODJ/s-l1600.webp',23,'2024-03-24 13:59:49.315','2024-07-09 13:39:09.237','Labrada'),
	 ('ISOJECT Premium EVOGEN – Whey Isolate tăng cơ VIP nhất','Bạn là người ăn chay và muốn sử dụng protein có nguồn gốc thực vật. Chúng tôi có thể đảm bảo với bạn PLANT PROTEIN sẽ mang đến hương vị thơm ngon thực sự, khả năng pha trộn tuyệt vời và kết cấu mịn..',2000000,1000000,'https://res.cloudinary.com/dr98sm712/image/upload/v1712160459/s2jrr1ze4yy6jny6zucj.jpg',65,'2024-03-10 09:28:24.981','2024-07-10 05:56:36.833','Labrada'),
	 ('ALPHA PUMP Hỗ Trợ Pump Cơ Hiệu Quả','Hỗ trợ tăng cơ bắp của bạn thông qua tăng lưu lượng máu, oxy và chất dinh dưỡng – Cải thiện hiệu suất tập luyện, năng lượng và sức bền – Tăng cường kết nối từ não đến cơ bắp với nootropics liều lâm sàng ',0,800000,'https://res.cloudinary.com/dr98sm712/image/upload/v1712160546/ozwgintb3uwnekpjvpgq.jpg',78,'2024-03-10 09:28:24.981','2024-07-03 10:14:38.289','Labrada'),
	 ('Super Huge Gain - MASS Evogen tăng cân đẳng cấp nhất','Super Huge Gain chứa 50 gram nguồn protein cao cấp hoàn chỉnh tăng trưởng cơ bắp tối đa kết hợp nguồn carb phức, giàu xơ hạn chế lên mỡ. Mass cao năng lượng tăng cân nhanh hương vị thơm ngon thanh khiết.',0,2000000,'https://www.thol.com.vn/wp-content/uploads/2019/07/Superhugemockcholateshake.jpg',2,'2024-03-10 09:28:24.981','2024-07-03 10:14:38.289','Labrada');
INSERT INTO public."Product" (name,description,old_price,new_price,image,available,created_at,update_at,brand) VALUES
	 ('Advanced Collagen Protein','Thực phẩm thể thao bổ sung protein hấp thụ nhanh chóng, giải pháp phục hồi cơ bắp tức thì. Advanced Collagen Protein với tác dụng đặc biệt là bổ sung collagen cải thiện độ đàn hồi da, trẻ hóa và hạn chế được vết nhăn.',1000000,10000,'https://res.cloudinary.com/dr98sm712/image/upload/v1712160485/ul0xnblmtexftgsdd04s.png',29,'2024-03-10 09:28:24.981','2024-07-11 04:15:42.365','Labrada'),
	 ('EVL Flexmode Advanced Joint Support - 90 viên','FlexMode Advanced Joint Support là sản phẩm hỗ trợ xương khớp mới nhất đến từ hãng Evlution Nutrition của Mỹ. Sản phẩm sẽ tạo lá chắn bảo vệ xương khớp, giúp người dùng hạn chế các chấn thương khi tập luyện hay vận động mạnh.',0,900000,'https://res.cloudinary.com/dr98sm712/image/upload/v1716391245/blog-mern-typescript/aquvfpy0nv366opvpxgr.jpg',79,'2024-05-22 15:20:45.987','2024-06-28 15:16:49.959','EVL NUTRITION'),
	 ('EVL Z-Matrix Recovery & Sleep Complex - 240 viên','Evlution Nutrition (EVL Nutrition) là một trong top brand TPBS hàng đầu tại Hoa Kỳ. Thương hiệu này đã không ngừng đổi mới và nâng cấp phát triển sản phẩm của mình, nhằm đem lại những sản phẩm chất lượng nhất và hiệu quả nhất cho người tiêu dùng.',0,490000,'https://res.cloudinary.com/dr98sm712/image/upload/v1718899333/blog-mern-typescript/dmzm35ziugzxpdkr4bk1.png',67,'2024-06-20 16:02:12.56','2024-07-10 02:03:53.18','EVL NUTRITION'),
	 ('Ostrovit Glucosamine + MSM + Chondroitin - 90 viên','OstroVit Glucosamine MSM Chondroitin là viên uống hỗ trợ xương khớp là thực phẩm chức năng bổ sung vào chế độ ăn uống hàng ngày với Glucosamine, MSM và Chondroitin. Đây là 3 thành phần nổi tiếng trong nhiệm vụ giữ cho khớp xương luôn duy trì ở trạng thái tốt nhất.',0,700000,'https://res.cloudinary.com/dr98sm712/image/upload/v1716391175/blog-mern-typescript/evqosqcv09xoaxrsfzje.jpg',89,'2024-05-22 15:19:35.912','2024-07-03 06:55:47.625','Ostrovit '),
	 ('Orgain Collagen Peptides 1lbs','Ngủ là khoảng thời gian cơ thể nghỉ ngơi, phục hồi và đào thải độc tố. Mất ngủ không chỉ khiến cơ thể cơ thể mệt mỏi, hay cáu gắt, giảm tốc độ phục hồi cơ bắp mà còn là nguyên nhân dẫn đến nhiều căn bệnh trầm trọng.',0,700000,'https://res.cloudinary.com/dr98sm712/image/upload/v1716391539/blog-mern-typescript/gxvjv3zynjw6tuo63yxj.jpg',86,'2024-05-22 15:25:39.427','2024-07-03 06:58:13.075','Orgain'),
	 ('EVP EXTREME – Preworkout VIP Nhất Của Rambod Và Evogen Team','Hỗ trợ tăng năng lượng & tập trung tỉnh táo tối đa trong tập luyện. Tăng cơ & cường độ tập luyện Sở hữu 3000mg Citrulline giúp bạn loại bỏ độc tố khi tập luyện và các chất thải amoniac.
