	 ('Nutrabolics Semtex, 60 v-Capsules','Semtex là viên uống đốt mỡ mới nhất, hiệu quả nhất của Nutrabolics, giúp bạn đốt cháy mỡ thừa, hỗ trợ giảm cân và chuyển hóa chất béo thành năng lượng cho việc luyện tập thêm sung hơn, bền bỉ hơn.',700000,510000,'https://res.cloudinary.com/dr98sm712/image/upload/v1718898308/blog-mern-typescript/gttlgiz9cqry8wejiuz3.png',100,'2024-06-20 15:45:08.215','2024-06-22 15:18:23.925','Nutrabolic'),
	 ('LEAN BODY RTD PLANT BASED – BỮA ĂN THAY THẾ THUẦN CHAY, GIÀU PROTEIN','Bạn là người ăn chay và muốn sử dụng protein có nguồn gốc thực vật. Chúng tôi có thể đảm bảo với bạn PLANT PROTEIN sẽ mang đến hương vị thơm ngon thực sự, khả năng pha trộn tuyệt vời và kết cấu mịn..',0,1500000,'https://res.cloudinary.com/dr98sm712/image/upload/v1712160471/lmz5dgsmxju5so0ueayn.jpg',278,'2024-03-10 09:28:24.981','2024-07-03 10:14:38.289','Labrada'),
	 ('REDCON1 MRE Meal Replacement – Bữa ăn thay thế thơm ngon phục hồi và sửa chữa cơ hiệu quả','MRE Meal Replacement được tin dùng bởi quân đội Mỹ. Nguồn dinh dưỡng tối ưu cũng như tính tiện lợi sản phẩm giúp những người lính bổ sung tốt năng lượng sau những giờ phút hoạt động mạnh mẽ ngoài chiến trường.',0,2100000,'https://res.cloudinary.com/dr98sm712/image/upload/v1712160591/rldk2bb5etmnfwnmk6ov.png',96,'2024-03-10 09:28:24.981','2024-07-09 13:42:03.493','Labrada');

