	 ('LEAN BODY RTD – NGUỒN DINH DƯỠNG GIÀU PROTEIN TIỆN LỢI THƠM NGON','Sản phẩm chứa tới 40g protein trong mỗi khẩu phần, hỗ trợ tốt cho quá trình tăng cơ, phục hồi tốt sau tập luyện. Nguồn protein chất lượng cao, hoàn toàn không chứa gluten cũng như protein từ đậu. Bổ sung nguồn dinh dưỡng vi lượng thiết yếu cho cơ thể với hơn 22 vitamin và khoáng chất. Quan trọng hơn hết, Lean Body RTD còn góp phần hỗ trợ hệ tiêu hóa khỏe mạnh và hấp thu dinh dưỡng tốt hơn.',0,1290000,'https://res.cloudinary.com/dr98sm712/image/upload/v1718897610/blog-mern-typescript/xgtkovxq9whugrk8lpwk.jpg',62,'2024-06-20 15:33:29.83','2024-07-10 04:42:21.621','Labrada'),
	 ('GHOST Legend ALL OUT Pre-Workout, 20 Servings','Ghost Legend ALL OUT là phiên bản Pre Workout có hàm lượng mạnh nhất từ trước đến nay của nhà Ghost LifeStyle. 
Bên trong sản phẩm LEGEND ALL OUT cung cấp tới 6g Citrulline đến từ cả L-Citrulline và Citrulline Nitrat. Kết hợp với đó là hỗn hợp GHOST SMART ENERGY với 400mg Caffeine đến từ nguồn Caffeeine Khan và zumXR extended release caffeine',0,1050000,'https://res.cloudinary.com/dr98sm712/image/upload/v1718898763/blog-mern-typescript/gq42wzzxakqnb6qlwet2.png',78,'2024-06-20 15:52:42.639','2024-07-03 10:14:38.289','GHOST'),
	 ('Lipo 6 Black Hers – TPBS hỗ trợ giảm cân cho nữ','Lipo 6 Black Hers giúp tăng cường quá trình trao đổi chất kích thích đốt cháy calo. Sản phẩm hỗ trợ kiểm soát sự thèm ăn giúp ngăn chặn cảm giác thèm ăn và ăn quá nhiều.',0,500000,'https://res.cloudinary.com/dr98sm712/image/upload/v1712160558/ystogoysnhw6e2rucca0.jpg',78,'2024-03-10 09:28:24.981','2024-07-03 10:14:38.289','Labrada');
